import React from "react";

import "./Header.css";

const Header = () => {
  return <div className="headerContainer">
    <div className="siteLogo">로고미정</div>
    <div className="siteName">이름미정</div>
    <div className="loginBtn">로그인</div>
  </div>;
};

export default Header;
